import {StyleSheet} from 'react-native';

const styles = StyleSheet.create({
    container: {
        flex: 1, 
        alignItems:'center', 
        justifyContent:'center'
    },
    direita: {
        backgroundColor: 'blue' ,
        borderRadius: 8 ,
        right: 30,
    },
    esquerda: {
        backgroundColor: 'red' ,
        borderRadius: 8 ,
        left: 30,
    }
});

export default styles
